  'can-map':
   [ '[can-map v4.3.3 - Handles props with undefined values ](https://github.com/canjs/can-map/releases/tag/v4.3.3)\nMakes sure that any props on the map are still added when their value is `undefined`, whether during construction or set later. PR#122 ',
     '[can-map v4.3.4 - Cleanup can-types.isMapLike(obj)](https://github.com/canjs/can-map/releases/tag/v4.3.4)\nReplace usage of `can-types.isMapLike(obj)` by `canReflect.isObservableLike(obj) && canReflect.isMapLike(obj)`',
     '[can-map v4.3.5 - Use Symbol to replace __inSetup property](https://github.com/canjs/can-map/releases/tag/v4.3.5)\nReplace `__inSetup` property checks with Symbol.\r\n\r\nhttps://github.com/canjs/canjs/issues/4705',
     '[can-map v4.3.6 - QUNIT2 upgrade](https://github.com/canjs/can-map/releases/tag/v4.3.6)\nThis updates the tests to use QUnit@2.x.x.\r\n\r\n#135 ',
     '[can-map v4.3.7 - Warn on mutations done at unsafe times](https://github.com/canjs/can-map/releases/tag/v4.3.7)\nObservable data (e.g. the properties of a can-map) should not be set while derived values are being computed. With this update, users will be warned in development mode in cases where this is happening.\r\n\r\n#137 ',
     '[can-map v4.3.8 - Tests using canReflect.getName in assertions fail in IE11](https://github.com/canjs/can-map/releases/tag/v4.3.8)\nTest failed due to `canReflect.getName` returning a certain value fail in IE11 because of how we name functions differently in IE11. With this fix, the tests use regular expressions to make the assertions less strict.\r\n\r\n[Issue #141](https://github.com/canjs/can-map/issues/141)',
     '[can-map v4.3.9](https://github.com/canjs/can-map/releases/tag/v4.3.9)',
     '[can-map v4.3.10 - Prevent bubble parent with children functions](https://github.com/canjs/can-map/releases/tag/v4.3.10)\nThis fixes bubbling the parent map with children functions as properties, for example:\r\n\r\n```js\r\nvar map = new CanMap({\r\n    fn: function() {}\r\n});\r\n\r\nbubble.childrenOf(map, "change");\r\n\r\nbubble.events(map.fn, "change"); // -> undefined\r\n```\r\n\r\n#146 \r\n\r\n',
     '[can-map v4.3.11 - Prevent bubble parent with children arrays](https://github.com/canjs/can-map/releases/tag/v4.3.11)\nChildren array properties should not bubble parent:\r\n\r\n```js\r\nvar map = new CanMap({\r\n     foo: [\'item\']\r\n});\r\n\r\nbubble.childrenOf(map, "change");\r\nbubble.events(map.attr("foo") // -> undefined\r\n```',
     '[can-map v4.3.12 - Fix attempts to bubble bind non-observable children](https://github.com/canjs/can-map/releases/tag/v4.3.12)\nAttempts to set up bubble bindings (i.e. deep "change" listeners) when map-like children of a can-map are not observable would cause errors.  This version of can-map now checks for observability on map-like children before attempting to set up bubble bindings.\r\n\r\nSee #150 for more.' ],
