     '[can-route v5.0.0 - Use of ObservableObject for the default route.data](https://github.com/canjs/can-route/releases/tag/v5.0.0)\nIn 4.0 the default `route.data` was a DefineMap. In 5.0 this is not an ObservableObject (from can-observable-object).\r\n\r\nFor most people no code changes are required. If your project must support IE11 then you\'ll need to create an alias to `can-route/src/routedata-definemap`. With [Steal](https://stealjs.com/) that looks like this:\r\n\r\n```html\r\n<script>\r\n  steal.config({\r\n    map: {\r\n      "can-route/src/routedata": "can-route/src/routedata-definemap"\r\n    }\r\n  });\r\n</script>\r\n```',
     '[can-route v5.0.1 - Add a warning when .data is set after .register() is called](https://github.com/canjs/can-route/releases/tag/v5.0.1)\n`.register()` will read `.data` when it‚Äôs called, so setting `.data` later may have unintended consequences. The new warning lets you know when `.data` is set after `.register()` is called.',
